import React from 'react';
import { NavLink } from 'react-router-dom';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';

const logos = [
    { image: require('./../../images/client-logo/actionlogement.jpeg') },
    { image: require('./../../images/client-logo/domofinance.jpeg') },
    { image: require('./../../images/client-logo/edf.jpeg') },
    { image: require('./../../images/client-logo/maprimepro.jpeg') },
    { image: require('./../../images/client-logo/qualibat.jpeg') },
    { image: require('./../../images/client-logo/qualipack.jpeg') },

]

class ClientsLogo extends React.Component {

    render() {
        const options = {
            loop: true,
            margin: 10,
            nav: true,
            dots: false,
            navText: ['<i class="fa fa-angle-left"></i>', '<i class="fa fa-angle-right"></i>'],
            responsive: {
                0: {
                    items: 2
                },
                480: {
                    items: 3
                },
                767: {
                    items: 4
                },
                1000: {
                    items: 5
                }
            }
        };
        return (
            <>
                <div className="section-full p-tb40 bg-black square_shape4 tm-client-wrap">
                    <div className="container">
                        <div className="section-content">
                            {/* TESTIMONIAL 4 START ON BACKGROUND */}
                            <div className="section-content">
                                <div className="row">
                                    <div className="col-md-4 col-sm-12">
                                        {/* TITLE START */}
                                        <div className="text-left">
                                            <h2 className="text-uppercase font-36 text-white">Nos partenaires</h2>
                                            <div className="wt-separator-outer">
                                                <div className="wt-separator bg-white" />
                                            </div>
                                        </div>
                                        {/* TITLE END */}
                                    </div>
                                    <div className="col-md-8 col-sm-12">
                                        <div className="section-content bg-white p-tb10">
                                            <OwlCarousel className="owl-carousel home-client-carousel owl-btn-center-v" {...options}>
                                                {logos.map((item, index) => (
                                                    <div className="item" key={index}>
                                                        <div className="ow-client-logo">
                                                            <div className="client-logo client-logo-media" >
                                                                <NavLink to={"aboutus"}><img style={{objectFit: "cover", height: "50px"}}src={item.image.default} alt="" /></NavLink>
                                                            </div>
                                                        </div>
                                                    </div>
                                                ))}
                                            </OwlCarousel>

                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </>
        );
    }
};

export default ClientsLogo;
